const initialState = {
    profile: '',
    tokenDetail: ''
}

const auth = (state = initialState, action) => {
    switch (action.type) {
        case 'LOGIN':
            return { ...state, profile: 'ok', tokenDetail: 'nice' }
        default:
            return state
    }
}
export default auth
